import {FETCH_DATA} from '../utilities/config';
const usersReducer = (state = {users:[]},action)=>
{
    console.log("get users");
    console.log(action);
    switch(action.type)
    {
        case FETCH_DATA:
            return {
                users : action.payload
            }
        default:
            return state;
    }
}
export default usersReducer;
